DROP TABLE IF EXISTS `currencies`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `currencies` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '币种符号',
  `logo` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT 'logo',
  `desc` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '简介',
  `decimal` int(11) NOT NULL DEFAULT '0' COMMENT '币种小数位',
  `accounts_display` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '都展示什么账户',
  `is_quote` int(11) NOT NULL DEFAULT '0' COMMENT '是否是计价币',
  `usd_price` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '币种美元价格',
  `cny_price` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '币种人民币价格',
  `draw_rate` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '提币费率',
  `draw_min` int(11) NOT NULL DEFAULT '0' COMMENT '最小提币量',
  `draw_max` int(11) NOT NULL DEFAULT '0' COMMENT '最大提币量',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `open_draw` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否开启提币',
  `micro_trade_fee` decimal(3,3) NOT NULL DEFAULT '0.001' COMMENT '交割下单费率',
  `open_recharge` tinyint(4) NOT NULL COMMENT '是否开启充币',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `is_pb` tinyint(3) DEFAULT '0' COMMENT '是平台币',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='系统币种表';
/*!40101 SET character_set_client = @saved_cs_client */;

