INSERT INTO `currencies` VALUES (1,'BTC','/uploads/20200708/750263d6773bd9ced0157325f50b482b.png','比特币（Bitcoin，简称BTC）是目前使用最为广泛的一种数字货币，它诞生于2009年1月3日，是一种点对点（P2P）传输的数字加密货币，总量2100万枚。比特币网络每10分钟释放出一定数量币，预计在2140年达到极限。比特币被投资者称为“数字黄金”。比特币依据特定算法，通过大量的计算产生，不依靠特定货币机构发行，其使用整个P2P网络中众多节点构成的分布式数据库来确认并记录所有的交易行为，并使用密码学设计确保货币流通各个环节安全性，可确保无法通过大量制造比特币来人为操控币值。基于密码学的设计可以使比特币只能被真实拥有者转移、支付及兑现。同样确保了货币所有权与流通交易的匿名性。',8,'[\"1\",\"2\",\"3\",\"4\"]',0,11950.00,83249.68,0.0010,10,10,'2019-09-10 00:39:51','2020-08-10 04:12:23',1,0.001,1,0,0),(2,'USDT','/uploads/20200708/f78bd7577c83199e012a4a26eaef42b3.png','泰达币（USDT）是Tether公司推出的基于稳定价值货币美元（USD）的代币Tether USD（下称USDT），1USDT=1美元，用户可以随时使用USDT与USD进行1:1兑换。Tether 公司严格遵守1：1的准备金保证，即每发行1个 USDT 代币，其银行账户都会有1美元的资金保障。用户可以在 Tether 平台进行资金查询，以保障透明度',8,'[\"1\",\"2\",\"3\",\"4\"]',1,1.00,6.97,0.0010,500,500,'2019-09-10 01:23:00','2020-08-10 04:11:39',1,0.001,1,0,0),(3,'ETH','/uploads/20200708/01b0b308d7fa8ce0c88e80e29c2042b2.png','以太坊（英文Ethereum）是一个开源的有智能合约功能的公共区块链平台，通过其专用加密货币以太币（Ether，简称“ETH”）提供去中心化的以太虚拟机（Ethereum Virtual Machine）来处理点对点合约。\n以太坊的概念首次在2013至2014年间由程序员Vitalik Buterin受比特币启发后提出，大意为“下一代加密货币与去中心化应用平台”，在2014年通过ICO众筹开始得以发展。\n截至2018年2月，以太币是市值第二高的加密货币，仅次于比特币。',18,'[\"1\",\"2\",\"3\",\"4\"]',1,400.00,2786.60,0.0010,1000,1000,'2019-09-10 19:36:07','2020-08-10 05:26:32',1,0.001,1,0,0),(4,'XRP','/uploads/20200708/48fdef9f959ed480547c0a54d8339368.png','瑞波币',0,'[\"1\"]',0,0.18,1.24,0.0100,10,1000,'2019-12-10 09:08:12','2020-07-08 07:03:02',1,0.001,1,0,0),(5,'EOS','/uploads/20200708/b752517e4203e37eafc8db748ad22be7.png','柚子币',0,'[\"1\",\"3\"]',0,2.47,17.44,0.0000,1,1000,'2019-12-10 09:28:30','2020-07-14 06:43:08',1,0.001,1,0,0),(6,'SPC','/uploads/20200708/cc400e149e627da7dea5f007212f3588.png','购物链SPC',0,'[]',0,0.00,0.00,1.0000,10,10000,'2020-03-16 02:05:02','2020-07-23 08:47:19',0,0.001,0,0,0),(8,'HT','/uploads/20200708/a5be6a359f3273ddef325a8d733c2f30.png','HT',0,'[\"1\"]',0,0.00,0.00,0.0000,1,10000,'2020-03-24 07:26:14','2020-07-08 07:05:03',1,0.001,1,0,0),(9,'OMG','