d09d4615abe59db7801870c68a3f.jpg','1',0,'[]',0,0.00,0.00,0.0010,1,10,'2020-07-10 08:53:24','2020-07-23 14:22:57',0,0.001,0,0,1),(24,'BPO','/uploads/20200723/c26a8dab5fdbda2681f466d959891bd7.png','Bit pro，简称（BPO） 。是全球第一个让区块链的可信性能够传递到用户日常 和商业场景的资产数字化和通证化生态系统。以区块链为可信基础，结合 5G 底 层通讯技术和人工智能技术，让资产可被确权、可交易和可消费。让人人都能拥 有数字资产，变现未来财富。从而将互联网打造为智能经济生态圈。javascript:;',0,'[\"1\",\"2\",\"3\",\"4\"]',0,0.06,0.40,0.0010,100000000,100000000,'2020-07-23 05:31:48','2020-08-10 05:20:49',0,0.001,1,0,0);
