DROP TABLE IF EXISTS `currency_matches`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `currency_matches` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `quote_currency_id` int(11) NOT NULL DEFAULT '0' COMMENT '计价币种id',
  `base_currency_id` int(11) NOT NULL DEFAULT '0' COMMENT '交易币种id',
  `market_from` tinyint(4) NOT NULL COMMENT '行情来自',
  `open_lever` int(11) NOT NULL DEFAULT '0' COMMENT '是否开启杠杆交易',
  `open_change` int(11) NOT NULL DEFAULT '0' COMMENT '开启币币交易',
  `open_iso` int(11) NOT NULL DEFAULT '0' COMMENT '开启逐仓合约',
  `open_microtrade` int(11) NOT NULL COMMENT '开启交割交易',
  `lever_point_rate` decimal(20,4) NOT NULL COMMENT '杠杆交易点差率',
  `lever_overnight_fee_rate` decimal(20,4) NOT NULL COMMENT '杠杆交易隔夜费率',
  `lever_fee_rate` decimal(20,4) NOT NULL COMMENT '杠杆交易手续费率',
  `change_fee_rate` decimal(20,4) NOT NULL DEFAULT '0.0000' COMMENT '币币交易手续费率',
  `use_process` int(11) NOT NULL DEFAULT '0' COMMENT '使用的撮合队列号',
  `lever_min_share` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '杠杆最低手数',
  `lever_max_share` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '杠杆最高手数',
  `lever_share_num` int(11) NOT NULL DEFAULT '1' COMMENT '每手数量',
  `auto_match` int(11) NOT NULL DEFAULT '0' COMMENT '是否自动吃单,行情来自机器人或火币有效',
  `match_user_id` int(11) NOT NULL DEFAULT '0',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `order_risk_rate` decimal(4,4) NOT NULL DEFAULT '0.0010' COMMENT '交割单控浮动率',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='交易对表';
