--
-- Table structure for table `iso_levers`
--

DROP TABLE IF EXISTS `iso_levers`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `iso_levers` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '买卖类型:1.买入,2.卖出',
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `currency_match_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '交易对id',
  `origin_price` decimal(20,4) NOT NULL DEFAULT '0.0000' COMMENT '原始价格',
  `fact_price` decimal(20,4) NOT NULL DEFAULT '0.0000' COMMENT '开仓价格(点差处理之后)',
  `update_price` decimal(20,4) NOT NULL DEFAULT '0.0000' COMMENT '当前价格',
  `target_profit_price` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '止盈价格',
  `stop_loss_price` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '止亏价格',
  `share` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '手数',
  `number` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '手数换算数量(非放大的)',
  `multiple` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '倍数',
  `origin_caution_money` decimal(20,4) NOT NULL DEFAULT '0.0000',
  `caution_money` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '当前可用保证金',
  `fact_profits` decimal(20,4) NOT NULL DEFAULT '0.0000' COMMENT '最终盈亏',
  `trade_fee` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '交易手续费',
  `overnight` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '隔夜费率',
  `overnight_money` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '隔夜费金额',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '交易状态:0.挂单中,1.交易中,2.平仓中,3.已平仓,4.已撤单',
  `settled` tinyint(4) NOT NULL DEFAULT '0' COMMENT '结算状态:0.未结算,1.已结算',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '下单时间',
  `transacted_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '交易时间',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '价格刷新时间(毫秒级)',
  `closed_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '平仓时间',
  `closed_type` int(11) NOT NULL DEFAULT '0' COMMENT '平仓类型:0.未知,1.市价,2.暴仓,3.止盈,4.止损,5.后台	',
  `agent_path` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '1' COMMENT '用户代理商关系记录',
  `boom_price` decimal(20,4) NOT NULL COMMENT '强平价',
  PRIMARY KEY (`id`),
  KEY `base_quote` (`user_id`,`status`),
  KEY `match_status` (`currency_match_id`,`status`,`boom_price`,`type`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

