DROP TABLE IF EXISTS `lever_account_logs`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `lever_account_logs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `currency_id` int(11) NOT NULL DEFAULT '0',
  `type` int(11) NOT NULL DEFAULT '0',
  `user_id` int(11) NOT NULL,
  `from_id` int(11) NOT NULL DEFAULT '0' COMMENT '预留字段',
  `before` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '更改前',
  `value` decimal(20,8) NOT NULL COMMENT '更改值',
  `after` decimal(20,8) NOT NULL COMMENT '更改后',
  `is_lock` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否锁定余额',
  `memo` varchar(255) NOT NULL DEFAULT '',
  `extra_data` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '扩展数据',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `user` (`user_id`,`currency_id`,`is_lock`) USING BTREE,
  KEY `currency` (`currency_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='账户日志表';
