CREATE TABLE `micro_orders` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `match_id` int(10) unsigned NOT NULL COMMENT '交易对id',
  `currency_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '支付的币种',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '买卖类型1.买涨,2.买跌',
  `is_insurance` tinyint(4) NOT NULL DEFAULT '0' COMMENT '订单险种:0.无,1.正向，2反向。',
  `seconds` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '秒数',
  `number` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '下单数量',
  `open_price` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '开仓价',
  `end_price` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '收盘价',
  `fee` decimal(20,4) unsigned NOT NULL COMMENT '手续费',
  `profit_ratio` decimal(3,2) unsigned NOT NULL COMMENT '收益率',
  `fact_profits` decimal(20,4) NOT NULL COMMENT '最终收益',
