</span><br data-filtered=\"filtered\"><span>• 20.2 本协议的最终解释权归本网站所有。</span><br data-filtered=\"filtered\"><span> </span><br data-filtered=\"filtered\"><span>了解你的客户和反洗钱政策</span><br data-filtered=\"filtered\"><strong>一、导言</strong><br data-filtered=\"filtered\"><span>• 1.1我们保证审慎遵守“了解你的客户”和反洗钱相关的法律法规且不得故意违反该《了解你的客户和反洗钱政策》。在我们合理控制的范围内我们将采取必要的措施和技术为您提供安全的服务，尽可能使您免于遭受犯罪嫌疑人的洗钱行为带来的损失。</span><br data-filtered=\"filtered\"><span>• 1.2我们的了解你的客户和反洗钱政策是一个综合性的国际政策体系，包括您隶属的不同法律辖区的了解你的客户和反洗钱政策。</span><br data-filtered=\"filtered\"><strong>二、了解你的客户和反洗钱政策如下：</strong><br data-filtered=\"filtered\"><span>• 2.1颁布了解你的客户和反洗钱政策并时时更新以满足相应的法律法规规定的标准；</span><br data-filtered=\"filtered\"><span>• 2.2颁布和更新运行本网站的一些指导原则和规则，且我们的员工将按照该原则和规则的指导提供服务；</span><br data-filtered=\"filtered\"><span>• 2.3 设计并完成内部监测和控制交易的程序，如以严格的手段验证身份，安排组建专业团队专门负责反洗钱工作；</span><br data-filtered=\"filtered\"><span>• 2.4 采用风险预防的方法对客户进行尽职调查和持续的监督;</span><br data-filtered=\"filtered\"><span>• 2.5 审查和定期检查已发生的交易;</span><br data-filtered=\"filtered\"><span>• 2.6 向主管当局报告可疑交易;</span><br data-filtered=\"filtered\"><span>• 2.7身份证明文件、地址证明文件和交易记录的证明文件将会维持至少六年，如被提交给监管部门，恕不另行通知您。</span><br data-filtered=\"filtered\"><strong>三、身份信息与核实确认</strong><br data-filtered=\"filtered\"><span>• 3.1 身份信息</span><br data-filtered=\"filtered\"><span>o 3.1.1 根据不同的司法管辖区的不同规定及不同的实体类型，我们收集的您的信息内容可能不一致，原则上将向注册的个人收集以下信息：</span><br data-filtered=\"filtered\"><span>o 个人基本信息：您的姓名，住址（及永久地址，如果不同） ，出生日期及国籍等可获得的其他情况。身份验证应该是根据官方或其他类似权威机构发放的文件，比如护照，身份证或其他不同的辖区要求的和引发的身份证明文件。您提供的地址将使用适当的方法进行验证，比如检查乘用交通工具的票据或利率票据或检查选民登记册等。</span><br data-filtered=\"filtered\"><span>o 有效的照片：在您注册之前，您须提供您的身份证件的照片；</span><br data-filtered=\"filtered\"><span>o 联系方式：电话/手机号码/或有效的电子邮件地址。</span><br data-filtered=\"filtered\"><span>o 3.1.2如果您是一个公司或其他合法实体，我们将收集以下信息以确定您或信托帐户的最终受益人。</span><br data-filtered=\"filtered\"><span>o 公司注册、登记证；公司的章程与备忘录副本；公司的股权机构和所有权说明的详细证明材料，证明决定本网站账户的开立以及执行的授权委托人的董事会决议；按照要求需要提供的公司董事、大股东及本网站账户有权签字人的身份证明文件；该公司的主要营业地址，如果与公司的邮寄地址不同，提供邮寄地址。如果公司在本地的地址与它的主要营业地址不一致的，则被视为风险较高的客户，需要提交额外附加文件。</span><br data-filtered=\"filtered\"><span>o •根据不同的司法管辖区的不同规定及不同的实体类型，我们要求的其他认证和权威部门发布的文件以及我们认为必要的文件。</span><br data-filtered=\"filtered\"><span>o 3.1.3 我们只接受英语版本或汉语版本的身份信息，如不是，请您将您的身份信息翻译成英文的版本并加以公证。</span><br data-filtered=\"filtered\"><span>• 3.2确认核实</span><br data-filtered=\"filtered\"><span>o 3.2.1我们要求您提供身份证明文件的全部页面内容。</span><br data-filtered=\"filtered\"><span>o 3.2.2 我们要求您提供您将您的身份证明文件的照片。</span><br data-filtered=\"filtered\"><span>o 3.2.3证明文件的副本一般应核和原始凭证进行核对。然而，如果某个可信赖的合适的认证人可证明该副本文件是原始文件准确而全面的复制的，该副本可接受。这样的认证人包括大使、司法委员、地方治安官等。</span><br data-filtered=\"filtered\"><span>o 3.2.4 对识别最终受益人和账户控制权的要求是确定哪些个人最终所有或控制直接客户，和/或确定正在进行的交易是由他人代为执行。如果是企业，则大股东的身份（例如那些持有10％或以上的投票权益）应被验证。一般，持股25 ％会被认定为正常风险内，其股东身份须验证；持股10%或拥有更多的投票权或股票时被认定为高风险的情况，股东身份须加以验证。</span><br data-filtered=\"filtered\"><strong>四、监控交易</strong><br data-filtered=\"filtered\"><span>• 4.1 我们根据安全性和实际交易情况时时设置和调整日常交易和提币最高限额;</span><br data-filtered=\"filtered\"><span>• 4.2如果交易频繁集中发生在某个注册用户或存在超乎合理的情况，我们的专业团队将评估并决定他们是否可疑;</span><br data-filtered=\"filtered\"><span>• 4.3我们凭借自身的判断认定为可疑交易的情况，我们可能会采取暂停该交易、拒绝该交易等限制性措施，甚至如果可能将尽快逆转该交易，同时向主管部门报告，但不会通知您;</span><br data-filtered=\"filtered\"><span>• 4.4我们保留拒绝来自于不符合国际反洗钱标准辖区的人或可被视为政治公众人物的人的注册申请，我们保留随时暂停或终止根据我们自身判断为可疑交易的交易，但我们这样做并不违反对您的任何义务和责任。</span></p>',0,'2019-10-15 06:31:00','2020-08-01 07:06:58','https://admin.379maq.com/images/zwtp.png','https://admin.379maq.com/images/zwtp.png',0,''),(67,27,3,'手机banner1',0,'管理员','0','0','0',0,'2020-03-17 06:59:27','2020-07-23 13:09:29','https://admin.379maq.com/uploads/20200605/9fe216b6462cb98c48a8e8566ea8d110.png','/uploads/20200723/d74876f8f3d34dd4b3b32e5514c14ba4.png',0,''),(68,27,3,'手机banner2',0,'管理员','0','0','0',0,'2020-03-17 06:59:42','2020-07-23 13:10:04','https://admin.379maq.com/uploads/20200605/49e8f653308ab6dad536c10a0c5bdf7d.png','/uploads/20200723/c9c8acf764f788f1eb56d4beba1e5ec5.png',0,''),(69,27,3,'手机banner3',0,'管理员','0','0','0',0,'2020-03-17 06:59:59','2020-07-23 13:13:28','https://admin.379maq.com/uploads/202006