t limits on the rise or fall in price, and market makers and global government policies may cause major fluctuations in their prices;<br data-filtered=\"filtered\">• 4. The Company may suspend or terminate your account or use of the Service, or the processing of any digital asset transaction, at any time if it determines in its sole discretion that you have violated this Agreement or that its provision or your use of the Service in your jurisdiction is unlawful.</p><p><strong>Digital assets trading is highly risky and therefore not suitable for the vast majority of people. You acknowledge and understand that investment in digital assets may result in partial or total loss of your investment and therefore you are advised to decide the amount of your investment on the basis of your loss-bearing capacity. You acknowledge and understand that digital assets may generate derivative risks. Therefore, if you have any doubt, you are advised to seek assistance from a financial adviser first. Furthermore, aside from the above-mentioned risks, there may also be unpredictable risks. Therefore, you are advised to carefully consider and use clear judgment to assess your financial position and the abovementioned risks before making any decisions on buying and selling digital assets; any and all losses arising therefrom will be borne by you and we shall not be held liable in any manner whatsoever.</strong></p><p>You are hereby informed that:</p><p>• 1. You understand that this Website is only intended to serve as a venue for you to obtain digital asset information, find trading counterparties, hold negotiations on and effect transactions of digital assets. This Website does not participate in any of your transactions, and therefore you shall, at your sole discretion, carefully assess the authenticity, legality and validity of relevant digital assets and/or information, and solely bear the responsibilities and losses that may arise therefrom.<br data-filtered=\"filtered\">• 2. All opinions, information, discussions, analyses, prices, advice and other information on this Website are general market reviews and do not constitute any investment advice. We do not bear any loss arising directly or indirectly from reliance on the abovementioned information, including but not limited to, any loss of profits.<br data-filtered=\"filtered\">• 3. The content of this Website may be changed from time to time and at any time without notice, and we have taken reasonable measures to ensure the accuracy of the information on the Website; however, we do not guarantee the degree of such accuracy, or bear any loss arising directly or indirectly from the information on this Website or from any delay or failure caused by failure to link up with the internet, transmit or receive any notice and information<br data-filtered=\"filtered\">• 4. Using internet-based trading systems also involves risks, including but not limited to failures in software, hardware or Internet links, etc. In view of the fact that we cannot control the reliability and availability of the Internet, we will not be responsible for any distortion, delay and link failure.<br data-filtered=\"filtered\"><p>• 5.&nbsp;<a href=\"https://www.huobi.sc/\" target=\"_blank\" rel=\"noopener\">https://www.379maq.com</a>&nbsp;is the sole official external information release platform for this Website;</p>• 6. It is prohibited to use this Website to engage in any illegal transaction activities or illegitimate activities, such as money laundering, smuggling and commercial bribery. In the event that any suspected illegal transaction activities or illegitimate activities is uncovered, this Website will adopt all available measures, including but not limited to freezing the offender’s account, notifying relevant authorities, etc., and we will not assume any of the responsibilities arising therefrom and reserve the right to hold relevant persons accountable;<br data-filtered=\"filtered\">• 7. It is prohibited to use this Website for the purpose of malicious manipulation of the market, improper transactions or any other illicit trading activities. Where any of such illicit trading activities is uncovered, this Website will adopt such preventive and protective measures as warning, restricting trading and closing accounts against any and all such malicious manipulation of prices, maliciously influencing the trading system and any other illicit behaviors; we do not assume any of the responsibilities arising therefrom and reserve the right to hold relevant persons accountable.</p><p><strong>• 1. General Provisions</strong></p><p>• 1.1 The User Agreement (hereinafter referred to as \"this Agreement\" or \"these terms and conditions\") consists of the main body, Terms of Privacy, Understanding Your client and Anti-money-laundering Policy, as well as any rules, statements, instructions, etc. that this Website has published or may publish in the future.<br data-filtered=\"filtered\">• 1.2 Before using the services offered by this Website, you shall read this Agreement carefully, and consult a professional lawyer if you have any doubt or as may be otherwise necessary. If you do not agree to the terms and conditions of this Agreement and/or any change made thereto from time to time and at any time, please immediately stop using the service provided by this Website or stop logging onto this Website. Upon your logging into this Website or using any service offered by this Website or engaging in any other similar activity, it shall be deemed as having understood and fully agreeing to all terms and conditions of this Agreement, including any and all changes, modifications or alterations that this Website may make to this Agreement from time to time and at any time.<br data-filtered=\"filtered\">• 1.3 After filling in the relevant information in accordance with the requirements of this Website, and going through other relevant procedures, you will successfully register yourself as a member of this Website (hereinafter referred to as \"Member\"); in the process of registration, if you click on the \"I Agree\", it shall be deemed that you have reached an agreement with the Company by way of electronic signature; or when you use this Website, you click on the \"I Agree\" button or a similar button, or if you use the services offered by this Website in any of the ways allowed by this Website, it shall be deemed that you fully understand, agree to and accept all the terms and conditions under this Agreement, and in this case, the absence of your handwritten signature will not affect the legal binding force that this Agreement may have on you.<br data-filtered=\"filtered\">• 1.4 After you become a member of this Website, you will receive a member account and corresponding password, which shall be properly kept by you as a member of this Website; Members shall be liable for all activities and events carried out through their accounts.<br data-filtered=\"filtered\">• 1.5 You cannot engage in trading on the digital asset trading platform provided by this Website and gain access to the services that are exclusively available to members in accordance with the rules and regulations of this Website, unless and until you become a member of this Website; if you are not a member of this Website, you can only log in to and browse the Website and have access to other services as are permitted by the rules and regulations of this Website.<br data-filtered=\"filtered\">• 1.6 Upon registering yourself as a member of this Website and using any of the services and functions offered by this Website, it shall be deemed that you have read, understood this Agreement, and:<br data-filtered=\"filtered\">• 1.6.1 accepted to be bound by all terms and conditions of this Agreement;<br data-filtered=\"filtered\">• 1.6.2 You confirm that you have attained the age of 16, or another statutory age for entering into contracts as is required by a different applicable law, and your registration with this Website, purchase or sale via this Website, release information on this Website and other behaviors indicating your acceptance of the Services offered by this Website shall comply with the relevant laws and regulations of the sovereign state or region that has jurisdiction over you, and you confirm that you have sufficient capacity to accept these terms and conditions, enter into transactions and to use this Website for digital asset transactions.<br data-filtered=\"filtered\">• 1.6.3 You undertake that all your digital assets involved in transactions hereunder are legally acquired and owned by you.<br data-filtered=\"filtered\">• 1.6.4 You agree to undertake any and all liabilities for your own transaction and non-transaction activities as well as any and all profits and losses therefrom.<br data-filtered=\"filtered\">• 1.6.5 You confirm that the information provided at the time of registration is true and accurate.<br data-filtered=\"filtered\">• 1.6.6 You agree to comply with any and all relevant laws, including the reporting of any transaction profits for tax purposes.<br data-filtered=\"filtered\">• 1.6.7 You agree to always refrain from engaging in or participating in any act or activity that damages the interests of this Website or the Company, whether or not in connection with the Services provided by this Website.<br data-filtered=\"filtered\">• 1.6.8 This Agreement is only binding on the rights and obligations between you and us, and does not involve legal relations and legal disputes arising from and relating to the transaction of digital assets between the users of this Website, and between other websites and you.</p><p><strong>2. Amendment of this Agreement</strong></p><p>We reserve the right to amend this Agreement from time to time, and disclose such amendment by way of announcement on the Website without sending a separate notice to you on your rights. The date when the amendment is made will be indicated on the first page of the amended agreement. The amended agreement will take effect immediately upon announcement on the Website. You shall browse this Website from time to time and follow information on the time and content of amendments, if any, made to this Agreement. If you do not agree with the amendments, you shall stop using the services offered by this Website immediately; if you continue to use the services offered by this Website, it shall be deemed that you accept and agree to be bound by the amended agreement.</p><p><strong>3.Registration</strong></p><p>• 3.1 Eligibility for Registration You confirm and promise that: you shall be a natural person, legal person or other organization with the ability to sign this Agreement and the ability to use the services of this Website, as is provided by applicable laws, when you complete the registration process or when you use the services offered by this Website in any other manner as is otherwise permitted by this Website. Upon clicking on the button indicating that you agree to register, it shall be deemed that you yourself or your authorized agent agrees to the content of this Agreement and your authorized agent will register with this Website and use the services offered by this Website on your behalf. If you are not a natural person, legal person or organization with the abovementioned ability, you and your authorized agent shall bear all the consequences of that, and the company reserves the right to cancel or permanently freeze your account and to hold you and your authorized agent accountable.<br data-filtered=\"filtered\">• 3.2 Purpose of Registration You confirm and promise that you do not register with this Website for the purpose of violating any of the applicable laws or regulations or undermining the order of digital asset transactions on this Website.<br data-filtered=\"filtered\">• 3.3 Registration Process<br data-filtered=\"filtered\">• 3.3.1 You agree to provide a valid email address, a mobile phone number and other information in accordance with the requirements on the user registration page of this Website. You can use the email address, mobile phone number or any other manner permitted by this Website to log in to this Website. Where it is necessary and in accordance with the requirements of applicable laws and regulations of relevant jurisdictions, you shall provide your real name, identity card and other information required by applicable laws, regulations, the Terms of Privacy, and anti-money-laundering terms, and constantly update your registration data so that they will be timely, detailed and accurate as is required. All of the original typed data will be referenced as registration information. You shall be responsible for the authenticity, integrity and accuracy of such information and bear any direct or indirect loss and adverse consequences arising out of it.<br data-filtered=\"filtered\">• 3.3.2 If any of the applicable laws, regulations, rules, orders and other regulatory documents of the sovereign country or region in which you are based requires that mobile phone accounts must be based on real names, you hereby confirm that the mobile phone number you provide for registration purposes has gone through the real-name registration procedure. If you cannot provide such a mobile phone number as is required, any direct or indirect losses and adverse consequences arising therefrom and affecting you shall be borne by you.<br data-filtered=\"filtered\">• 3.3.3 After you provide the required registration information in a legal, complete and valid manner and such information passes relevant verification, you shall have the right to obtain an account and a password of this Website. Upon obtaining such account and password, your registration shall be deemed as successful and you can log into this Website as a member thereof.<br data-filtered=\"filtered\">• 3.3.4 You agree to receive emails and/or short messages sent by this Website related to the management and operation thereof.</p><p><strong>4．Services</strong></p><p>This Website only provides online transaction platform services for you to engage in digital asset trading activities through this Website (including but not limited to the digital asset transactions etc.). This Website does not participate in the transaction of digital assets as a buyer or seller; This Website does not provide any services relating to the replenishment and withdrawal of the legal currency of any country.<br data-filtered=\"filtered\">• 4.1 Content of Services<br data-filtered=\"filtered\">• 4.1.1 You have the right to browse the real-time quotes and transaction information of digital asset products on this Website, to submit digital asset transaction instructions and to complete the digital asset transaction through this Website.<br data-filtered=\"filtered\">• 4.1.2 You have the right to view information under the member accounts on this Website and to apply the functions provided by this Website.<br data-filtered=\"filtered\">• 4.1.3 You have the right to participate in the website activities organized by this Website in accordance with the rules of activities posted on this Website.<br data-filtered=\"filtered\">• 4.1.4 Other services that this Website promises to offer to you.<br data-filtered=\"filtered\">• 4.2 Service Rules You undertake to comply with the following service rules of this Website:<br data-filtered=\"filtered\">• 4.2.1 You shall comply with the provisions of applicable laws, regulations, rules, and policy requirements, and ensure the legality of the source of all digital assets in your account, and shall refrain from engaging in any illegal activities or other activities that damages the rights and interests of this Website or any third party, such as sending or receiving information that is illegal, illicit or infringes on the rights and interests of any other person, sending or receiving pyramid scheme information or information or remarks causing other harms, unauthorized use or falsification of the email header information of this Website, inter alia.<br data-filtered=\"filtered\">• 4.2.2 You shall comply with applicable laws and regulations and properly use and keep your account in this Website and login password, password of your financial transactions, and the mobile phone number bound with your account that you provide upon registration of your account, as well as the security of the verification codes received via your mobile phone. You shall be solely responsible for any and all your operations carried out using your account with this Website and login password, financial transaction password, verification codes sent to your mobile phone, as well as all consequences of such operations. When you find that your account with this Website, your login password, financial transaction password, or mobile phone verification codes is used by any unauthorized third party, uncover any other problem relating to the security of your account, you shall inform this Website in a prompt and effective manner, and request this Website to temporarily suspend the services to your account with this Website. This Website shall have the right to take action on your request within a reasonable time; nonetheless, this Website does not bear any liability for the consequences that have arisen before such action is taken, including but not limited to any loss that you may sustain. You may not assign your account with this Website to any other person by way of donation, lending, leasing, transfer or otherwise without the consent of this Website.<br data-filtered=\"filtered\">• 4.2.3 You agree to take responsibility for all activities (including but not limited to information disclosure, information release, online click-approving or submission of various agreements on rules, online renewal of agreements or purchase service) using your account and password with this Website.<br data-filtered=\"filtered\">• 4.2.4 In your digital asset transactions on this Website, you may not maliciously interfere with the normal proceeding of the digital asset transaction or disrupt the transaction order; you may not use any technical means or other means to interfere with the normal operation of this Website or interfere with the other users\' use of the services; you may not maliciously defame the business goodwill of this Website on the ground of falsified fact.<br data-filtered=\"filtered\">• 4.2.5 If any dispute arises between you and any other user in connection with online transaction, you may not resort to any means other than judicial or governmental means to request this Website to provide relevant information.<br data-filtered=\"filtered\">• 4.2.6 All taxes payable as well as all fees relating to hardware, software and services that are incurred by you in the course of using the services provided by this Website shall be solely borne by you.<br data-filtered=\"filtered\">• 4.2.7 You shall abide by this Agreement and other terms of service and operating rules that this Website may release from time to time, and you have the right to terminate your use of the services provided by this Website at any time.<br data-filtered=\"filtered\">• 4.3 Product Rules<br data-filtered=\"filtered\">• 4.3.1 Rules for trading products You undertake that in the process in which you log into this Website and engage in transactions with other users through this Website, you will properly comply with the following transaction rules.<br data-filtered=\"filtered\">• 4.3.1.1 Browsing transaction information When you browse the transaction information on this Website, you should carefully read all the content in the transaction information, including but not limited to the price, consignment, handling fee, buying or selling direction, and you shall accept all the contents contained in the transaction information before you may click on the button to proceed with the transaction.<br data-filtered=\"filtered\">• 4.3.1.2 Submission of Commission After browsing and verifying the transaction information, you may submit your transaction commissions. After you submit the transaction commission, it shall be deemed that you authorize this Website to broker you for the corresponding transactions, and this Website will automatically complete the matchmaking operation when there is a transaction proposal that meets your price quotation, without prior notice to you.<br data-filtered=\"filtered\">• 4.3.1.3 Accessing transaction details You can check the corresponding transaction records in the transaction statements by the Management Center, and confirm your own detailed transaction records.<br data-filtered=\"filtered\">• 4.3.1.4 Revoking/modifying transaction commission. You have the right to revoke or modify your transaction commission at any time before the transaction is concluded.</p><p><strong>5.Rights and Obligations of this Website</strong></p><p>• 5.1 If you do not have the registration qualifications agreed on in this Agreement, this Website shall have the right to refuse to allow you to register; if you have already registered, this Website shall have the right to revoke your member account, and this Website reserves the right to hold you or your authorized agent accountable. Furthermore, this Website reserves the right to decide whether to accept your application for registration under any other circumstances.<br data-filtered=\"filtered\">• 5.2 When this Website finds at its sole discretion that you or your associated account user is not suitable for high-risk investment, this Website shall have the right to suspend or terminate the use of your account and all associated accounts thereof.<br data-filtered=\"filtered\">• 5.3 When this Website finds out that the user of an Account is not the initial registrant of that Account, it shall have the right to suspend or terminate the user\'s access to that Account.<br data-filtered=\"filtered\">• 5.4 Where by means of technical testing or manual sampling, among others, this Website reasonably suspects that the information you provide is wrong, untrue, invalid or incomplete, this Website shall have the right to notify you to correct or update the information, or suspend or terminate its supply of the services to you.<br data-filtered=\"filtered\">• 5.5 This Website shall have the right to correct any information displayed on this Website when it uncovers any obvious error in such information.<br data-filtered=\"filtered\">• 5.6 This Website reserves the right to modify, suspend or terminate the Services offered by this Website, at any time, and the right to modify or suspend the Service without prior notice to you; if this Website terminates one or more of the Services offered by this Website, such termination by this Website will take effect on the date of announcement of such termination on the Website.<br data-filtered=\"filtered\">• 5.7 This Website shall take necessary technical means and management measures to ensure the normal operation of this Website, and shall provide a necessary and reliable trading environment and transaction services, and shall maintain the order of digital assets trading.<br data-filtered=\"filtered\">• 5.8 If you fail to log into this Website using your member account number and password for an uninterrupted period of one year, this Website shall have the right to revoke your account. After your account is revoked, this Website shall have the right to offer the member name represented by such account to other applicants for membership.<br data-filtered=\"filtered\">• 5.9 This Website shall ensure the security of your digital assets by strengthening technical input and enhancing security precautions, and is under the obligation to notify you in advance of the foreseeable security risks in your account.<br data-filtered=\"filtered\">• 5.10 This Website shall have the right to delete all kinds of content and information which does not conform to laws and regulations or the rules of this Website at any time, and exercise of this right by this Website is not subject to a prior notice to you.<br data-filtered=\"filtered\">• 5.11 This Website shall have the right to, in accordance with the applicable laws, administrative regulations, rules, orders and other regulatory documents of the sovereign country or region where you are based, request to you for more information or data, and to take reasonable measures to meet the requirements of the local standards, and you have the obligation to provide proper assistance to such measures; this Website shall have the right to suspend or permanently terminate your access to this Website as well as part or all of the services offered by this Website.</p><p><strong>6.Indemnity</strong></p><p>• 6.1 Under any circumstance, our liability for your direct damage will not exceed the total cost incurred by your three (3) months\' use of services offered by this Website.<br data-filtered=\"filtered\">• 6.2 Shall you breach this Agreement or any applicable law or administrative regulation, you shall pay to us at least US$ Two million in compensation and bear all the expenses in connection with such breach (including attorney\'s fees, among others). If such compensation cannot cover the actual loss, you shall make up for the difference.</p><p><strong>7. The Right to Injunctive Relief</strong></p><p>Both you and we acknowledge that common law remedies for breach of agreement or possible breach of contract may be insufficient to cover all the losses that we sustain; therefore, in the event of a breach of contract or a possible breach of contract, the non-breaching party shall have the right to seek injunctive relief as well as all other remedies that are permitted under common law or equity.<br data-filtered=\"filtered\"><strong>8．Limitation and Exemption of Liability</strong></p><p><strong>• 8.1 You understand and agree that under no circumstance will we be held liable for any of the following events:</strong><br data-filtered=\"filtered\"><strong>• 8.1.1 loss of 