d by this Website;</strong><br data-filtered=\"filtered\"><strong>• 8.2.5 Any other losses related to the services provided by this Website, which cannot be attributed to us.</strong><br data-filtered=\"filtered\"><strong>• 8.3 Where we fail to provide the Services or delay in providing such Services due to information network equipment maintenance, information network connectivity failures, errors in computer, communications or other systems, power failures, weather conditions, unexpected accidents, industrial actions, labor disputes, revolts, uprisings, riots, lack of productivity or production materials, fires, floods, storms, explosions, wars, failure on the part of banks or other partners, collapse of the digital asset market, actions by government, judicial or administrative authorities, other acts that are not within our control or beyond our inability to control, or due to causes on the part of third parties, we shall not assume any responsibility for such failure to provide service or delay in providing services, or for the resultant loss you may sustain as a result of such failure or delay.</strong><br data-filtered=\"filtered\"><strong>• 8.4 We cannot guarantee that all the information, programs, texts, etc. contained in this Website are completely safe, free from the interference and destruction by any malicious programs such as viruses, trojans, etc., therefore, your log-into this Website or use of any services offered by this Website, download of any program, information and data from this Website and your use thereof are your personal decisions and therefore you shall bear the any and all risks and losses that may possibly arise.</strong><br data-filtered=\"filtered\"><strong>• 8.5 We do not make any warranties and commitments in connection with any of the information, products and business of any third party websites linked to this Website, as well as any other forms of content that do not belong to us; your use any of the services, information, and products provided by a third party website is your personal decision and therefore you shall assume any and all the responsibilities arising therefrom.</strong><br data-filtered=\"filtered\"><strong>• 8.6 We do not make any explicit or implicit warranties regarding your use of the Services offered by this Website, including but not limited to the applicability, freedom from error or omission, consistency, accuracy, reliability, and applicability to a specific purpose, of the services provided by this Website. Furthermore, we do not make any commitment or guarantee in connection with the validity, accuracy, correctness, reliability, quality, stability, integrity and timeliness of the technology and information covered by the services offered by this Website. Whether to log in this Website or use the services provided by this Website is your personal decision and therefore you shall bear all the risks and possible losses arising from such decision. We do not make any explicit or implicit warranties in connection with the market, value and price of digital assets; you understand and acknowledge that the digital asset market is unstable, that the price and value of assets may fluctuate or collapse at any time, and that the transaction of digital assets is based on your personal free will and decision and therefore you shall assume any and all risks and losses that may possible arise therefrom.</strong><br data-filtered=\"filtered\"><strong>• 8.7 The guarantees and undertakings specified in this Agreement shall be the only guarantee and statements that we make in connection with the Services provided by us under this Agreement and through this Website, and shall supersede any and all the warranties and commitments arising in any other way and manner, whether in writing or in words, express or implied. All these guarantees and statements represent only our own commitments and undertakings and do not guarantee any third party\'s compliance with the guarantees and commitments contained in this Agreement.</strong><br data-filtered=\"filtered\"><strong>• 8.8 We do not waive any of the rights not mentioned in this Agreement and to the maximum extent permitted by the applicable law, to limit, exempt or offset our liability for damages.</strong><br data-filtered=\"filtered\"><strong>• 8.9 Upon your registration of your account with this Website, it shall be deemed that you approve any and all operations performed by us in accordance with the rules set forth in this Agreement, and any and all risks arising from such operations shall be assumed by you.</strong></p><p><strong>9.Termination of Agreement</strong><br data-filtered=\"filtered\">• 9.1 This Website shall have the right to terminate all Service offered by this Website to you in accordance with this Agreement, and this Agreement shall terminate on the date of termination of all services offered by this Website to you.<br data-filtered=\"filtered\">• 9.2 After the termination of this Agreement, you do not have the right to require this Website to continue to provide you with any service or perform any other obligation, including, but not limited to, requesting this Website to keep or disclose to you any information in your former original account, or to forward to you or any third party any information therein that is not read or sent.<br data-filtered=\"filtered\">• 9.3 The termination of this Agreement shall not prevent the observant party from demanding the breaching party to assume other liabilities.</p><p><strong>10．Intellectual Property</strong></p><p>• 10.1 All intellectual achievements included in this Website, including, but not limited to, website logos, databases, website design, text and graphics, software, photos, videos, music, sounds and any combinations of the aforementioned files, and the intellectual property rights of software compilation, associated source code and software (including small applications and scripts) shall be owned by this Website. You may not copy, modify, copy, transmit or use any of the foregoing materials or content for commercial purposes.<br data-filtered=\"filtered\">• 10.2 All rights contained in the name of this Website (including but not limited to business goodwill and trademarks, logos) shall be owned by the Company.<br data-filtered=\"filtered\">• 10.3 Upon accepting this Agreement, it shall be deemed that you, on the basis of your own free will, have transferred and assigned exclusively and free of charge to this Website all copyright of any form of information that you publish on this Website, including, but not limited to copyrights, distribution rights, lease rights, exhibition rights, performance rights, projection rights, broadcasting rights, information network dissemination rights, shooting rights, adaptation rights, translation rights, compilation rights and other transferable rights that copyright owners are entitled to, and this Website shall have the right to sue for any infringement on such copyright and obtain full compensation for such infringement. This Agreement shall apply to any content that is published by you on this Website and is protected by copyright law, regardless of whether the content is generated before or after the signing of this Agreement.<br data-filtered=\"filtered\">• 10.4 You shall not illegally use or dispose of the intellectual property rights of this Website or any other person during your use of the services offered by this Website. For any information that you publish on this Website, you may not publish or authorize other websites (or media) to use such information in any manner wuatsoever.<br data-filtered=\"filtered\">• 10.5 Your log into this Website or use of any of the services offered by this Website shall not be deemed as our transfer of any intellectual property to you.</p><p><strong>11.Information protection</strong></p><p>Regarding the collection and use of your personal information and storage protection, the privacy policy publicized on this website shall prevail.</p><p><strong>12．Calculation</strong></p><p>All the transaction calculations are verified by us, and all the calculation methods have been posted on the Website, but we can not ensure that your use of this Website will not be disturbed or free from errors.</p><p><strong>13.Export Control</strong></p><p>You understand and acknowledge that in accordance with relevant laws of the&nbsp;<span><span class=\"skip\"><a data-keyword=\"United\">United</a><span class=\"Apple-converted-space\">&nbsp;</span><a data-keyword=\"States\">States</a></span></span>&nbsp;you shall not export, re-export, import or transfer any material (including software) on this Website; therefore, you hereby undertake that you will not voluntarily commit or assist or participate in any of the above export or related transfer or other violations of applicable laws and regulations; if you uncover any of the aforementioned events, you will report to us and assist us in handling them.</p><p><strong>14．Transfer</strong></p><p>The rights and obligations agreed in this Agreement shall be equally binding on the assignees, the heirs, executors and administrators of the parties hereto who benefit from the rights and obligations. Without our consent, you may not transfer to any third party any of your rights or obligations hereunder, provided, however, we may, at any time, assign our rights and obligations under this Agreement to any third party with thirty (30) days\' notice to you.</p><p><strong>15.Severability</strong></p><p>If any provision of this Agreement is found unenforceable, invalid or illegal by any court of competent jurisdiction, validity of the remaining provisions of this Agreement shall not be affected.</p><p><strong>16．No Agency</strong></p><p>Nothing in this Agreement shall be deemed to have created, implied or otherwise treated us as your agent, trustee or other representative, unless it is provided otherwise in this Agreement.</p><p><strong>17.Waiver</strong></p><p>Our or your waiver of the right to hold the other party liable for breaches of agreement or any other liability as is agreed upon in this Agreement shall not be construed or deemed as a waiver of the right to hold the other party for other breaches of contract; a failure to exercise any right or remedy shall not be construed in any way as a waiver of such right or remedy.</p><p><strong>18.Headings</strong></p><p>All headings herein are exclusively for the convenience of wording and are not intended to to expand or limit the content or scope of the terms and conditions of this Agreement.</p><p><strong>19．Applicable Law</strong></p><p>This Agreement in its entirety is a contract concluded under the laws of the Republic of Seychelles, and relevant laws of the Republic of Seychelles shall apply to its establishment, interpretation, content and enforcement; Any claims or actions arising out of or relating to the Services agreed in this Agreement shall be governed and interpreted and enforced in accordance with the laws of the Republic of Seychelles. For the avoidance of doubt, this Clause shall be expressly applicable to any tort claim against us. The competent court or forum for any claim or action against us or in relation to us shall be in the Republic of Seychelles. You have unconditional access to exclusive jurisdiction in court proceedings and appeals in the courts of the Republic of Seychelles. You also unconditionally agree that the venue or competent court for any dispute or problem relating to this Agreement or any claim and proceeding arising from this Agreement shall be exclusively in the Republic of Seychelles. If any other business of this Website is subject to any special agreement on jurisdiction, such agreement shall prevail. The Doctrine of Forum Non Conveniens does not apply to the court of choice under these Terms of Service.</p><p><strong>20.Entry into Force and Interpretation of the Agreement</strong></p><p>20.1 This Agreement shall enter into force when you click through the registration page of this Website, complete the registration procedures, obtain your account number and password of this Website, and shall be binding on you and this Website.&nbsp;<br data-filtered=\"filtered\">20.2 The ultimate power of interpretation of this Agreement shall be vested in this Website.<br data-filtered=\"filtered\"><br data-filtered=\"filtered\"><strong>Know-your-customers and Anti-Money Laundering Policies</strong><br data-filtered=\"filtered\"><strong>Preamble</strong></p><p>• 1.1 We ensure that we comply with know-your-customer and anti-money-laundering laws and regulations, and will not knowingly violate know-your-customers and anti-money-laundering policies. To the extent of our reasonable control, we will adopt necessary measures and technology to provide you with Services that are safe and secure, so as to protect you against the loss caused by money laundering to the greatest extent possible.<br data-filtered=\"filtered\">• 1.2 Our know-your-customer and anti-money-laundering policies are a comprehensive system of international policies, including the know-your-customer and anti-money-laundering policies of the jurisdictions to which you are subject to. Our robust compliance framework ensures that we meet regulatory requirements and regulatory standards on both the local and global levels, and ensure the operational sustainability of our website.</p><p><strong>Content of Our Know-Your-Customer and Anti-Money-Laundering Policies</strong></p><p>• 2.1 We promulgate and update know-your-customers and anti-money-laundering policies to meet the standards set by relevant laws and regulations;<br data-filtered=\"filtered\">• 2.2 We promulgate and update some of the guidelines and rules in connection with the operation of this Website, and our staff will provide you whole-process service in accordance with the guidelines and rules;<br data-filtered=\"filtered\">• 2.3 We design and complete the procedures for internal monitoring and transaction control, such as rigorous identity authentication procedures, and form a professional team responsible for anti-money laundering;<br data-filtered=\"filtered\">• 2.4 We adopt risk-prevention-based approach to carry out due diligence and continuous supervision in connection with customers;<br data-filtered=\"filtered\">• 2.5 Review and regularly inspect existing transactions;<br data-filtered=\"filtered\">• 2.6 To report suspicious transactions to the competent authorities;<br data-filtered=\"filtered\">• 2.7 Proof documents of identity documents, address certificates and transaction records will be maintained for at least six(6) years; if they are submitted to the regulatory authorities, let it be understood that a separate notice will not be provided to you;<br data-filtered=\"filtered\">• 2.8 Credit cards are prohibited throughout the course of the transaction;</p><p><strong>Identity Information and the Verification and Confirmation Thereof</strong></p><p>• 3.1 Identity Information<br data-filtered=\"filtered\">• 3.1.1 In accordance with the laws and regulations of relevant jurisdictions and in light of the nature of entities concerned, the content of your information as is collected by us may vary, and in principle, we will collect the following information of yours if you register as an individual: Basic personal information: your name, address (and permanent address, if the two are different), date of birth and nationality, and other information available. Identity authentication shall be based on documents issued by the official or other similar authorities, such as passports, identity cards or other identity documents as are required and issued by relevant jurisdictions. The address you provide will be validated in an appropriate manner, such as checking the fare ticket of means of transportation you use, your interest rate bills, or voter register. Valid photo: before you register, you must provide a photograph showing you holding your identity document in front of your chest; Contact information: telephone/mobile phone number and valid email address.<br data-filtered=\"filtered\">• 3.1.2 If you are a company or any other type of legal entity, we will collect the following information of yours to determine the final beneficiary of your account or your trust account. Your corporation enrollment and registration certificates of the company; a copy of the articles of association and memorandum of the company; the detailed certification materials of the ownership structure and ownership description of the company, and the decision of the board of directors on designating the authorized agent of the company responsible for the opening and execution of the account of the company with the website; the identity documents of the directors, major shareholders of the company as well as the authorized signatory for the company\'s account with the website, as are required to be provided in accordance with relevant rules; the company\'s main business address, and the company\'s mailing address if it is different from the main business address of the company. If the local address of the company is different from its main business address, the company shall be deemed to be a high-risk customer, and consequently the company will be required to provide additional documentation. Other certification documents, documents issued by competent authorities and other documents we may deem necessary in light of the laws and regulations of relevant jurisdictions and in light of the specific nature of your entity.<br data-filtered=\"filtered\">• 3.1.3 We only accept English and Chinese versions of your identity information; if your identity information is not in either of the two languages, you shall have your identity information translated into English and duly notarized.<br data-filtered=\"filtered\">• 3.2 Confirmation and Verification<br data-filtered=\"filtered\">• 3.2.1 You are required to provide both the front and back sides of your identity documents.<br data-filtered=\"filtered\">• 3.2.2 You are required to provide us with a photograph showing you holding your identity documents in front of your chest.<br data-filtered=\"filtered\">• 3.2.3 Copies of certification documents shall be checked against the originals thereof. Nonetheless, if a trusted and suitable certifier person can prove that such copies are accurate and comprehensive duplicates of the originals thereof, such copies shall be deemed as acceptable. Such certifiers include ambassadors, members of the judiciary, magistrates, etc.<br data-filtered=\"filtered\">• 3.2.4 The identification the ultimate beneficiary and controller of the account shall be based on the determination of which individuals ultimately own or control the direct customer and/or to determining that the ongoing transaction is performed by another person. If you are a business enterprise, the identity of major shareholders thereof (for example, those holding 10 % or more of the voting equity in such business enterprise) shall be verified. Generally, a shareholder holding 25 % of the shares of the company will be deemed as involving an average level of risk, and the identity of the shareholder shall be verified; a shareholder holding 10 % or more of the voting rights or shares is deemed to be involving a high level of risk, and the identity of the shareholder shall be verified.</p><p><strong>Transaction Supervision</strong></p><p>• 4.1 We constantly set and adjust daily trading and cash withdrawal limits based on security requirement and actual state of transactions;<br data-filtered=\"filtered\">• 4.2 If the transaction occurs frequently in an account registered by you or is beyond reasonable circumstances, our professional team will assess and determine whether such transaction is suspicious;<br data-filtered=\"filtered\">• 4.3 If we identify a specific transaction as suspicious on the basis of our assessment, we may adopt such restrictive measures as suspending the transaction or denying the transaction, and if it is possible, we may even reverse the transaction as soon as possible, and report to the competent authorities, without, however, notifying you;<br data-filtered=\"filtered\">• 4.4 We reserve the right to reject registration applications by applicants that do not comply with the international standards against money laundering or who may be regarded as political and public figures; we reserve the right to suspend or terminate a transaction identified as suspicious based on our own assessment, which, however, does not breach any of our obligations and duties to you.</p>',0,'2020-07-13 09:47:23','2020-08-01 09:42:57','https://admin.379maq.com/','https://admin.379maq.com/',0,''),(78,26,3,'Privacy policy',0,'管理员','Privacy policy','Privacy policy','<p class=\"p\"><b><span class=\"16\">Preamble and Reminder</span></b><span><br></span><span>BITTIMES. (hereinafter referred to as \"the Company\"), a company incorporated under the laws of the MSB USA, operates the BITTIMES APP (hereinafter referred to as “this Platform” or “the Platform”), which is a Platform that is exclusively used by users to trade digital assets and provides them with relevant Services (hereinafter referred to as \"the Services\"). For the convenience of wording in this Agreement, the Company and the Website are collectively referred to as “We” or other appropriate forms of the first-person pronouns. Any natural person or entity that logs into the Platform shall be a user thereof and are hereinafter referred to as \"You\" or any other applicable forms of the second-person pronouns. Hereinafter You and us are collectively referred to as \"both parties\", and individually as \"a party\".</span><span><br></span><span>We fully understand and respect the importance of Your personal information to You, and We will adopt corresponding appropriate safety protection measures to protect Your personal information in accordance with the requirements of the applicable laws and regulations. In view of this, this Privacy Policy (hereinafter referred to as \"this Policy/this Privacy Policy\") is formulated and the following reminder is provided to You:</span><span><o:p></o:p></span></p><p class=\"p\"><span>This Policy applies to all products and services We provide.</span><b><span class=\"16\">&nbsp;If another privacy policy is specifically applicable to any product or service We provide to You, such privacy policy shall prevail; otherwise, this Privacy Policy shall prevail.</span></b><span class=\"15\">&nbsp;</span><span><br></span><span>In particular,&nbsp;</span><b><span class=\"15\">this Policy does not apply to services provided to You by any third party, and such services shall be subject to a privacy policy that is otherwise specified to You.</span></b><span><br></span><b><span class=\"16\">Before using our products or services, please read carefully and thoroughly understand this Policy, and pay special attention to the clauses that are in bold type or underlined and in bold type, make sure that You fully understand and agree to them before You start using our products or services. If You have any question, comment or suggestion in connection with any content of this Policy, You can contact us through any of the contact methods officially provided by us. If You do not agree with any term or condition in this Policy, You should promptly stop accessing this Platform.</span></b><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">Part I Definition</span></b><span><br></span><b><span class=\"16\">Personal information:</span></b><span>&nbsp;various kinds of information recorded electronically or otherwise, which, alone or in combination with any other information, can identify the identity of a specific natural person or reflect the activities of a specific natural person.</span><span><br></span><b><span class=\"16\">Personal sensitive information:</span></b><span>&nbsp;personal information, including Identity Card number, personal biometric information, bank account numbers, property information, tracks of whereabouts, transaction information, and information of children who are not older than fourteen(14) years old, inter alia. (We will prominently identify specific personal sensitive information in bold type in this Privacy Policy).</span><span><br></span><b><span class=\"16\">Deletion of personal information:</span></b><span>&nbsp;the act of removing personal information from the systems involved in daily business functions to keep it in a state that cannot be retrieved or accessed.</span><span><br></span><b><span class=\"16\">Children:</span></b><span>&nbsp;minors under the age of fourteen(14).</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">Part II Privacy Policy</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>This Section will help You understand the following:</span><span><br></span><span>1. How We collect and use Your information</span><span><br></span><span>2. How We use Cookie and similar technologies</span><span><br></span><span>3. How We share, transfer and publicly disclose Your information</span><span><br></span><span>4. How We protect Your information</span><span><br></span><span>5. How You manage Your information</span><span><br></span><span>6. How We deal with the information of minors</span><span><br></span><span>7. How this Privacy Policy is updated</span><span><br></span><span>8. How to contact us</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">I. How We collect and use Your information</span></b><span><br></span><span>When You use our products and/or services, We need/may need to collect and use Your personal information, including the following two types of information:</span><span><br></span><b><span class=\"16\">1. In order to enable the basic functions of the services/products We provide to You, You need to authorize us to collect and use Your information as may be necessary. If You refuse to provide such information, You will not be able to use our products and/or services normally;</span></b><span><br></span><b><span class=\"16\">2. In order to enable the auxiliary functions of the services/products We provide to You, You may choose to authorize us to collect and use Your information as is necessary. If You refuse to provide such information, You will not be able to use the corresponding auxiliary functions or cannot achieve the intended effects of such functions, which, however, will not affected Your normal access to the basic functions of our products and/or services;</span></b><span><br></span><b><span class=\"16\">You understand and agree:</span></b><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">1. We are committed to creating diversified products and services to meet Your needs. As We provide a wide variety of products and services to You, and the specific range of products/services that different users choose to use may vary from person to person, therefore, the corresponding basic/additional functions of such services and products, as well as the types and ranges of personal information collected and used hereunder may also vary subject to the specific product/service functions.</span></b><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">2. In order to provide You with a better product and service experience, We are making continuous efforts to improve our technology. Subsequently, We may introduce new or optimized functions from time to time, and may need to collect and use new personal information or change the purpose or method of using such personal information. In this regard, We will separately explain to You the purpose, scope and usage of the corresponding information by updating this Policy, pop-up windows, page prompts, inter alia, and provide You with the means to choose and agree at Your discretion, and collect and use the corresponding information after obtaining Your express consent.</span></b><span>During this process, if You have any questions, comments or suggestions, You can contact us through various contact methods provided by this Platform, and We will provide a reply to You as soon as possible.</span><span><o:p></o:p></span></p><p class=\"p\"><span>We will collect and use Your personal information to realize the following functions under this Policy:</span><span><br></span><b><span class=\"16\">i. Help You register and provide You with the services offered by this Platform;</span></b><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">1. Registration Service</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>We provide You with basic membership services through Your account with the Platform. In order to register as a member and access our membership services, You need to fill in and provide the following information when applying for registration:</span><span><br></span><span>(1) Identity Information. Such information can help us verify whether You are eligible to be registered as a member of this Platform. Such information includes but is not limited to Your name, address of Your place of residence, and other certificates and corresponding numbers thereof that are issued by Your country or government to certify Your identity information, as well as all other information that can help us verify Your identity (hereinafter referred to as \"Identity Information\"). Such Identity Information may vary depending whether You are an individual user or institutional user. Furthermore, in accordance with the applicable laws and regulations of different jurisdictions, the information collected by the Platform from users may vary depending on the country or region that the users are from. The following information and data are intended to serve as an indicative example:</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">For an individual user:</span></b><span>&nbsp;his/her nationality, full legal name (including former names, if any, as well as his/her name presented in the local language of such individual user), Identity Card number, email address, telephone number, social security number (\"SSN\"), passport number or any other government-issued identity card number, date of birth, proof of identity (e.g. passport, driver\'s license or other identity certificates issued by the government).</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">For an institutional user:</span></b><span>&nbsp;its legal corporation name (including its legal corporation name in the local language of such user), registration information, business telephone number, personal information of the authorized representative, primary business premises, and personal information of all shareholders/beneficial owners thereof (passports or identity cards issued by the government), the corporate structure of the institutional user, documents relating to the formation of the institutional user, resolutions of the board of directors thereof, declaration of the source of funding thereof, risk and compliance control instructions and other information or documents as may be required by the Platform.</span><span><o:p></o:p></span></p><p class=\"p\"><span>(2) Service information. Such information helps us to contact You and successfully provide You with different forms of digital asset trading services. Such information includes but is not limited to: Your personal Identity Information, contact information, transaction information, as well as Your debit card information and/or other account information (hereinafter collectively referred to as \"Service Information\").&nbsp;</span><b><span class=\"16\">Furthermore</span></b><span>, let it be understood that the Services We provide to You are subject to constant update and development. If You choose to use any other service that is not covered by the above description, and therefore it is necessary for us to collect&nbsp;</span><b><span class=\"16\">additional</span></b><span>&nbsp;information of Yours based on such service, We will explain to You the scope and purpose of such information collection through notices on web pages, interactive processes, agreements, and pop-up prompts, among others, to obtain Your consent to such collection.</span><span><o:p></o:p></span></p><p class=\"p\"><span>If You only need to use the browsing service, You do not need to register as a member and provide the above information.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">2. Other Registration Services</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>Real-name authentication: after You register and log in, You need to enter the \"Personal Center\" to complete the real-name authentication. During the process of such real-name authentication, You need to provide Your real name, identity card number or passport number to the Platform.</span><span><o:p></o:p></span></p><p class=\"p\"><span>Advanced Certification: when Your transaction volume on this Platform exceeds a certain limit, the Platform will require You to undergo advanced certification, in order to ensure the safety of Your assets. You agree that in such advanced authentication process, in addition to providing the information required for the real name authentication, You will also undergo the advanced authentication procedures of \"facial recognition\", as is required by the Platform. Facial recognition will involve the collection of Your relevant video streams or face images by the Platform.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">Account Information Display: if You already have an account with the Platform, We may display Your above-mentioned personal information in the services (for real-name authentication, only the outcome of such authentication will be displayed, i.e., whether You have passed such authentication or not) and the operations You perform in the products and services associated with Your account with the Platform, including centralized display of Your personal data and transaction orders through Your Platform account. We respect Your choices in connection with the set-up of Your account with the Platform.</span></b><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">ii. Security Management Services and Service Information Push Services</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>When You use the services provided by this Platform or access this Platform, in order to ensure Your transaction security and the safe and stable operation of services, this Platform needs to automatically receive and record Your web browser information, Your device information, including the device identification information (the type and model of device through which You log into Your account), Your IP address and records on the web page You request to visit, Your location, network environment, device fingerprint information, service log information, software information, location information, inter alia.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">Please note that device information alone cannot identify a specific natural person.</span></b><span>&nbsp;If We use this kind of non-personal information in combination with other information to determine the identity of a specific natural person, or use it in combination with personal information, such non-personal information will be regarded as personal information during such combination. Unless otherwise authorized by You or required by any of the applicable laws and regulations, We will anonymize such information and remove all identification marks therein.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">In order to provide You with more convenient and personalized information display and push services, We may extract Your preferred features based on Your device information and Your browsing and usage information on this Platform or the client thereof in the future, and generate indirect group profiling based on such features, for the purpose of displaying and pushing information and possible commercial advertisements. If You do not agree to receive information pushed to You in this way, or wish to withdraw Your consent to the collection of Your personal information, You can contact us in accordance with the contact information provided under this Policy.</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>We strive to ensure Your browsing experience. If You do not want to receive the commercial advertising We send to You, You can unsubscribe to such advertising or otherwise disable this function by sending us a short text message or in any other way We specify.</span><span><o:p></o:p></span></p><p class=\"p\"><span>Furthermore, We will also use the above-mentioned information of Yours to continuously improve and optimize the above functions.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">iii. Keeping and Inquiry of Transaction Records</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>We collect data related to Your transactions on this Platform, including but not limited to transaction records. If You need to query Your order transaction records, You can query Your personal transaction details in the \"Order Management\" section of the Platform, which include: cyber name of the transaction counter-party, time of order placement, order serial numbers, transaction information, type and quantity of digital assets involved, inter alia.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">iv. Customer Service and Dispute Resolution</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>When You contact us or apply to us for in-sales and after-sales service or for dispute resolution,&nbsp;</span><b><span class=\"16\">We need You to provide necessary personal information to verify Your membership</span></b><span>, so as to ensure the security of Your account and the system.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">In order to facilitate our contact with You, help You solve the problems as soon as possible or record the solutions and results of the problems, We may keep Your communication records and related content (including Your account information, order information, other information You provide to prove the relevant facts, or contact information You provide). If You make queries, lodge complaints or provide suggestions in connection with any specific order, We will use Your account information and order information.</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>As may be reasonably necessary for us to provide services and improve service quality, We may also use other information of Yours, including the relevant information You provide when You contact our customer service department, and the replies You provide to our questionnaire surveys.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">v. Miscellaneous</span></b><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">1. If the information You provide involve any personal information of any other user, You must ensure that You have obtained legal authorization before providing such personal information to this Platform. If any personal information of any child is involved, You must obtain the consent of such child\'s guardian before You may release such information. Under the aforementioned circumstance, the guardian shall have the right to contact us in any of the ways specified under Article IX of this Policy to request for the correction or deletion of any content involving the personal information of such child.</span></b><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">2. If We use any information hereunder for any purpose not specified in this Policy, or use any information collected for any specific purpose for any purposes other than such specific purpose, or We take the initiative to obtain Your personal information from a third party, We will obtain Your prior consent.</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>If We obtain Your information indirectly from a third party, We will explicitly require such third party in writing to obtain Your prior consent in accordance with law before collecting any personal information of Yours, inform You of the content of Your information that such third party shares with us, and obtain Your explicit confirmation before providing us with any sensitive information of Yours; furthermore, we will require such third party to provide an undertaking as to the legality and compliance of the source of personal information such third party provides to us. If the third party violates any of the applicable laws, We will explicitly require such third party to bear the corresponding legal responsibilities; furthermore, We will strengthen the security of personal information (including by proper filing of sensitive information, encrypted storage of sensitive information, access control, inter alia). We will use no less than the same methods and measures used by us to protect the personal information of our users to protect such personal information indirectly obtained by us.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">3. Exceptions to the Requirements for Authorization and Consent</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>You fully understand and agree that under any of the following circumstances Your authorization is not required for us to collect and use Your personal information, and We are not obliged to respond to Your requests for correction/modification, deletion and cancellation of your information, or your requests for the withdrawal of your consent or your requests to access your information:</span><span><br></span><span>(1) Where state security and/or national defense security are involved;</span><span><br></span><span>(2) Where public security, public health and/or major public interests are involved;</span><span><br></span><span>(3) Where judicial or administrative enforcement, e.g., criminal investigation, prosecution, trial and sentence enforcement, is involved;</span><span><br></span><span>(4) Where it is for the purpose of protecting Your or another person’s life, property and/or any other important legal rights and interests, yet it is difficult to obtain the consent of Yours or such person, as the case may be;</span><span><br></span><span>(5) Where such information is Your personal information that You disclose to the public by Yourself;</span><span><br></span><span>(6) Where such information is Your personal information that is collected from legally disclosed information, such as legal news reports and government information disclosures, inter alia.</span><span><br></span><span>(7) Where it is required by any agreement or any other written document signed with You;</span><span><br></span><span>(8) Where it is necessary for maintaining the safe and stable operation of the products and/or services provided hereunder, such as uncovering and handling errors and faults in the products and/or services hereunder;</span><span><br></span><span>(9) Where it is necessary for legal news reporting;</span><span><br></span><span>(10) Where it is necessary for any public-interests-based statistical survey or academic research by any academic research institute, and when the results of such research or survey are provided externally, the personal information contained in such results shall be neutralized; and</span><span><br></span><span>(11) Other circumstances stipulated by any of the applicable laws and regulations.</span><span><o:p></o:p></span></p><p class=\"p\"><span>Please be aware that in accordance with the applicable laws,&nbsp;</span><b><span class=\"16\">if We adopt technical measures and other necessary measures to process personal information so that the data recipient cannot re-identify a specific individual and cannot restore such personal information to its status prior to our processing</span></b><span>, or We may conduct unmarked research, statistical analysis and prediction on the collected information to improve the content and layout of this Platform, to provide product or service support for business decisions, and to improve our products and services (including using anonymous data for machine learning or model algorithm training),</span><b><span class=\"15\">&nbsp;then the use of such processed information shall not be subject to a separate notice to You or Your consent.</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>4. If We stop operating the products or services of this Platform, We will stop collecting Your personal information in a timely manner, notify You of such termination of operation either through a special one-on-one notice to You or a general public announcement, and we will delete or anonymize the personal information that We hold in connection with such terminated business.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">II. How We Use Cookies</span></b><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">If Your browser or browser’s add-on service permits, You can change the setting of Your browser so as to modify its degree of cookie acceptance or so that Your browser rejects Our cookies.</span></b><span>&nbsp;For more details, please refer to AboutCookies.org. However, if You make such changes, it may affect Your safe access to our Platform under certain circumstances, and in this case, You may need to change Your user settings every time You visit our Platform. You understand and agree that:</span><span><o:p></o:p></span></p><p class=\"p\"><span>1. When You visit our Platform, we will use Google Stats via cookies to record our performance and check the effect of online advertising. Cookies are small amounts of data sent to Your browser and stored on Your computer hard drive. Cookies can only be sent to Your computer hard disk when You use Your computer to access our Platform.</span><span><br></span><span>2. Cookies are often used to record the habits and preferences of visitors when they visit various items on our Platform. The data collected via cookies are anonymous collective statistics and do not contain personal data.</span><span><br></span><span>3. Cookies cannot be used to obtain data on Your hard disk, Your email address, or Your personal data; instead, they enable the Platform or service provider’s system to recognize Your browser and capture and remember information. Most browsers are preset to accept cookies. You can choose to set Your browser to refuse to accept cookies, or to notify You as soon as cookies are installed. However, if Your browser is preset to prohibit cookies, You may be unable to start or use some features of our Platform.</span><span><br></span><span><br></span><b><span class=\"16\">III. How We share, transfer and publicly disclose Your information</span></b><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">(1) Sharing</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>We will not share Your personal information with any company, organization and individual other than service providers of this Platform, except for under any of the following circumstances:</span><span><br></span><span>1. Sharing under statutory circumstances: we may share Your personal information externally in accordance with applicable laws and regulations, or as may be necessary for litigation and dispute resolution requirements, or as is required by administrative and judicial authorities.</span><span><br></span><span>2. Sharing with explicit consent: after obtaining Your explicit consent, We will share Your personal information with other parties.</span><span><br></span><span>3. Sharing subject to Your voluntary choice: We will, in accordance with Your choice, share with the transaction counter-party of the digital assets the necessary information related to the transaction in Your order information, so as to meet Your transactions related to transaction and after-sales services.</span><span><br></span><span>4. Sharing with authorized partners: we will share information with our affiliated parties and trusted third parties that help us operate our Platform, carry out business or provide services to You, as long as these parties agree to keep the information strictly confidential; We will share information when We believe that such disclosure of information is appropriate, in compliance with laws, regulations, rules and regulations or orders from courts of law or other competent authorities, implements our Platform strategy, is required for the normal operation of the Platform, is required for related parties to provide services or protect our or any other person’s rights, property or safety.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">ii. Transfer</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>We will not transfer Your personal information to any company, organization or individual except for under any of the following circumstances:</span><span><br></span><span>1. Transfer subject to explicit consent: After obtaining Your explicit consent, We will transfer Your personal information to another party;</span><span><br></span><span>2. In the event of the merger, acquisition or bankruptcy liquidation of the Platform, or any other situation involving merger, acquisition or bankruptcy liquidation, if the transfer of personal information is involved therein, We will require the new company or organization holding Your personal information originally held by us to continue abiding by this Policy; otherwise We will require such company or organization or individuals involved to seek Your authorization and consent.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">iii. Public Disclosure</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>We will only publicly disclose Your personal information under the following circumstances:</span><span><br></span><span>1. We may publicly disclose Your personal information with Your explicit consent or based on Your voluntary choice;</span><span><br></span><span>2.&nbsp;</span><b><span class=\"16\">If We determine that You have violated any of the applicable laws and regulations or seriously violated any of the relevant agreement or rules of the Platform, or in order to protect the personal and property safety of users of the Platform or the public from infringement, We may disclose Your personal information in accordance with the applicable laws and regulations or with Your consent,</span></b><span>including relevant violations and measures already taken against You by the Platform.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">iv. Exceptions to the requirements for Your prior authorization and consent for the sharing, transfer or public disclosure of your personal information</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>Under the following circumstances, the sharing, transfer or public disclosure of Your personal information is not subject to Your prior authorization and consent:</span><span><br></span><span>(1) where state security and/or national defense security are involved;</span><span><br></span><span>(2) where public security, public health and/or major public interests are involved;</span><span><br></span><span>(3) Where judicial or administrative enforcement, e.g., criminal investigation, prosecution, trial and sentence enforcement, is involved;</span><span><br></span><span>(4) Where it is for the purpose of protecting Your or another person’s life, property and/or any other important legal rights and interests, yet it is difficult to obtain the consent of Yours or such person, as the case may be;</span><span><br></span><span>(5) Where such information is Your personal information that You disclose to the public by Yourself; and</span><span><br></span><span>(6) Where such information is Your personal information that is collected from legally disclosed information, such as legal news reports and government information disclosures, inter alia.</span><span><o:p></o:p></span></p><p class=\"p\"><span>Please be aware that in accordance with the applicable laws,&nbsp;</span><b><span class=\"16\">if We adopt technical measures and other necessary measures to process personal information so that the data recipient cannot re-identify a specific individual and cannot restore such personal information to its status prior to our processing, then the sharing, transfer or public disclosure of such personal data so processed shall not be subject to notification to You or consent by You.</span></b><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">IV. How We protect Your information</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>1. We implement proper physical, electronic, management and technical measures to protect and safeguard Your personal data. We will exert our best efforts to ensure that any personal data collected through our Platform are free from any nuisance caused by any third party unrelated to us. The safety measures We adopt include but are not limited to:</span><span><br></span><span>(1) Physical measures: Records containing Your personal data will be stored in a properly locked place.</span><span><br></span><span>(2) Electronic measures: Computer data containing Your personal information will be stored in computer systems and storage media that are subject to strict log-in restriction.</span><span><br></span><span>(3) Management measures: We have set up an internal safety defense department to protect the users\' information, established relevant internal control systems, and adopted the principle of strict authorization for our employees who may come into contact with Your information; therefore, only properly authorized employees are permitted to come into contact with Your personal information and such employees must comply with our internal confidentiality rules for personal data. Furthermore, we provide sustained training to our staff on relevant laws and regulations, privacy and safety guidelines, enhance publicity and education on safety awareness, and organize our relevant internal personnel to carry out emergency response training and emergency drills on a regular basis, so as to enable them to fully understand their job duties and emergency response strategies and procedures.&nbsp;</span><span><br></span><span>(4) Technical Measures: encryption technology such as Secure Socket Layer Encryption may be adopted to transfer Your personal data.</span><span><br></span><span>(5) Security Measures: In order to ensure Your information security, we are committed to using various currently available general security technologies and supporting management systems to minimize the risks that Your information may be disclosed, damaged, misused, accessed without authorization, disclosed without authorization or altered. For example, the Secure Socket Layer (SSL) software is used for encrypted transmission, encrypted information storage and strict restriction of data center access. When transmitting and storing sensitive personal information (including personal biometric information), we will adopt security measures such as encryption, authority control, removal of identification marks, and de-sensitization, inter alia.</span><span><br></span><span>(6) Other measures: We regularly review our personal data collection, storage and processing procedures; furthermore, we limit the access of our employees and suppliers to Your data in accordance with the principle of “as necessary”, and our employees and suppliers must abide by strict contractual confidentiality obligations.</span><span><br></span><span>2. If You become aware of any security vulnerability of our Platform, please contact us promptly so that We can adopt appropriate actions as soon as possible.</span><span><br></span><span>3. Despite the above-mentioned technical and security measures, We cannot guarantee the absolute safety of data transmission on the Internet, so We cannot absolutely guarantee that the personal data You provide to us through our Platform are safe at all times. We will not regularly update and make public security risks and personal information security impact assessment reports, inter alia, which You can obtain through announcements made by this Platform.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">V. How You manage Your information</span></b><span><o:p></o:p></span></p><p class=\"p\"><span>You can access and manage Your information in any of the following ways:</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">i. Query, correct and delete Your information</span></b><span><br></span><span>You have the right to obtain a copy of Your personal data upon Your request, and to determine whether the information we have about You is accurate and up-to-date. If any of Your personal data is not accurate, You can request to update Your information. You can also request for the deletion of Your personal data, provided, however, we may reject Your deletion request in some cases, e.g., where such rejection is required by law or for other legal purposes. For data access, correction or deletion requests, please contact us according to the contact information under Article VIII hereof.</span><span><br></span><span>In response to application for access to or correction or deletion of data, we will verify the identity of the applicant to ensure that such applicant is legally entitled to make such application. Although our goal is to respond to such application on a gratuitous basis, we reserve the right to charge You a reasonable fee if Your request is repeated or onerous.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">ii. Changing the scope of Your authorization</span></b><span><br></span><span>The fulfillment of each business function is subject to certain basic personal information (see Part I of this Privacy Policy). Furthermore, You can contact us through the contact information under Article VIII to grant or withdraw Your authorization.</span><span><br></span><span>When You withdraw Your consent, We will no longer process the corresponding personal information.&nbsp;</span><b><span class=\"16\">However, Your decision to withdraw Your consent will not affect the existing personal information processing based on Your authorization.</span></b><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">iii. Cancellation of Your account</span></b><span><br></span><span>You can contact us through the contact information under Article VIII hereof to apply for cancellation of Your account. After You voluntarily cancel Your account, We will stop providing You with products or services, and delete Your personal information or anonymize it in accordance with the requirements of applicable laws.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">iv. Respond to Your above requests</span></b><span><br></span><span>To ensure safety, You may need to provide a written request or prove Your identity in other ways. We may ask You to verify Your identity before processing Your request.</span><span><br></span><span>We will reply within fifteen(15) days. If You are not satisfied with our reply, You can also initiate a complaint through the contact information provided by us.</span><span><br></span><span>In principle, We do not charge any fee on Your reasonable requests, provided, however, We may charge a certain fee on Your repeated requests or requests that exceed reasonable limits, based on the actual circumstances. We may reject requests involving information that is not directly related to Your identity, unjustified repeated information, or requests that require too many technical means (e.g. to develop new systems or fundamentally change existing practices), requests that pose risks to any other person\'s legitimate rights and interests, or are unrealistic.</span><span><br></span><span>Under the following circumstances, We will not be able to respond to Your request in accordance with applicable laws and regulations:</span><span><br></span><span>1. where state security and/or national defense security are involved;</span><span><br></span><span>2. where public security, public health and/or major public interests are involved;</span><span><br></span><span>3. Where judicial or administrative enforcement, e.g., criminal investigation, prosecution, trial and sentence enforcement, is involved;</span><span><br></span><span>4. Where there is sufficient evidence proving that the owner of such personal information has subjective malice or abuse of power;</span><span><br></span><span>5. Where response to Your request would cause serious damage to the legitimate rights and interests of You or any other individual or organization;</span><span><br></span><span>6. Where any trade secret is involved.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">VI. How We deal with the information of minors</span></b><span><br></span><span>This Platform is not open to children. If We find or suspect that the user is under 14 years old, We will ask the user to close his account and will not allow the user to continue to use the Platform products or services. We will delete the relevant information as soon as possible. If You know that anyone under the age of 14 uses our services, please inform us so that We can take action to prevent them from obtaining our products or services.</span><span><br></span><span>If we find out or suspect that a user is less than fourteen (14) years old, we will ask the user to close his/her account and will not allow the user to continue using the products and services of the Platform. We will delete the relevant information of such users as soon as possible. If You know that any person who is under the age of fourteen (14) uses our services, please notify us so that we can adopt actions to prevent such user from accessing our products or services.</span><span><br></span><span>For minors who have reached the age of fourteen(14) but are less than eighteen(18) years old, We expect their parents or guardians to guide such minors in using our services. We will protect the confidentiality and security of such minors\' information in accordance with relevant state laws and regulations.</span><span><br></span><span>If You are a minor, it is recommended that Your parents or guardians read this Policy and use our services or provide us with Your information subject to the consent of Your parents or guardian. If we collect Your information with the consent of Your parents or guardians, we will only use or disclose such information when it is permitted by law, expressly approved by Your parents or guardian or is necessary for protecting Your rights and interests. If Your parents or guardian disagrees with Your use of our services or Your providing us with information in accordance with this Policy, please stop using our services promptly and inform us in time so that we can take corresponding measures.</span><span><br></span><span>If You are the parent or guardian of a minor, please contact us through the contact information hereunder when You have any questions in connection with our processing of the information of the minor of whom You are a parent or guardian.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">VII. How this Privacy Policy is updated</span></b><span><br></span><span>Our Privacy Policy is subject to changes.</span><span><br></span><span>Without Your explicit consent, We will not restrict Your rights under this Privacy Policy. We will publish any and all changes to this Privacy Policy via official channels. If You do not agree with any such change, You should stop accessing this Platform promptly. After an updated version of this Privacy Policy is released, Your continued visit to this Platform shall be deemed as showing and indicating that You agree with such update and agree to abide by the updated version of this Privacy Policy.</span><span><br></span><span>For any major change made hereto, We will also issue more prominent notices (including notices made in the form of public announcements made through this Platform and even pop-up prompts to You).</span><span><br></span><span>Major changes referred to in this Policy include but are not limited to:</span><span><br></span><span>1. Significant changes in our service mode. For example, the purpose of processing personal information, the types of personal information processed, the ways in which personal information is used, inter alia.</span><span><br></span><span>2. Significant changes in our control. Such as changes in information controllers caused by any merger and acquisition, inter alia;</span><span><br></span><span>3. Any change in the major person(s) which personal information hereunder is shared with, transferred or publicly disclosed to;</span><span><br></span><span>4. Significant changes in Your right to participate in personal information processing and the way You exercise such right;</span><span><br></span><span>5. Changes in our department responsible for personal information security, or changes in the contact information of such department, or the ways in which complaints hereunder are lodged; and</span><span><br></span><span>6. The security impact assessment report for personal information hows that there is a high degree of risks.</span><span><o:p></o:p></span></p><p class=\"p\"><b><span class=\"16\">VIII. How to Contact Us</span></b><span><br></span><span>1. If You have any requirement and opinion, You can contact us by e-mail at&nbsp;</span><b><span class=\"16\">support@379maq.com</span></b><span>, which is the only valid and official e-mail address through which We communicate with You. Therefore, We are not responsible for any act or omission that arises due to Your failure to use a valid way of contact.</span><span><o:p></o:p></span></p><p class=\"p\"><span>2. We will publish announcements and information exclusively through the effective contact information on this Platform or post announcements on this Platform, so We are not responsible for any losses arising from Your trust in information that is not obtained through the aforementioned methods.</span><span><o:p></o:p></span></p><p class=\"p\"><span>3. If You have any question about our Privacy Policy, please feel free to contact us at any time.</span></p>',0,'2020-07-13 09:48:51','2020-08-03 09:14:09','https://admin.379maq.com/','https://admin.379maq.com/',0,''),(79,25,3,'Business application',0,'管理员','Business application','Business application','<p>The company\'s legal currency trading zone authentication merchant service agreement</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>The company - over-the-counter (OTC)</p><p><br></p><p>Please confirm that you have read this Agreement and all legal documents and rules of the Website in detail before starting the certification process, and once you start the certification process, you fully understand and agree to accept this Agreement and all legal documents and trading rules of the Website. In order to improve the security of transactions and the credibility of the identity of registered users of the platform, the company\'s professional site (hereinafter referred to as the site) to provide you with authentication services. When you apply for authentication, the Website reserves the right to take such measures as it deems necessary to identify the user, but as an ordinary Internet service provider, the Website makes no guarantee for the accuracy and absolute authenticity of the user identification results.</p><p><br></p><p><br></p><p><br></p><p>(1) Materials required for certification</p><p><br></p><p>1. Mobile phone number;</p><p><br></p><p>2. Email number;</p><p><br></p><p>3. WeChat number;</p><p><br></p><p>4. Emergency contact person, emergency contact number and relationship with the person;</p><p><br></p><p>5. Permanent address;</p><p><br></p><p>6. This page of my account;</p><p><br></p><p>7. Proof of address (property ownership certificate, rental contract or utility bill);</p><p><br></p><p>8. Video proof (record as required by template);</p><p><br></p><p>9. Other materials required by the Platform for compliance.</p><p><br></p><p><br></p><p><br></p><p>(2) Asset deposit</p><p><br></p><p>1. After the certified merchants pass the KYC and anti-money laundering review, the Platform will require the certified merchants to deposit a certain amount of deposit in their platform accounts to ensure the security and smooth transactions on the platform.</p><p><br></p><p>2. The specific amount of the deposit will be displayed in the personal information of the certified merchants on the platform.</p><p><br></p><p>3. In case of the following circumstances, the platform has the right to deduct the deposit of the certified merchants, etc. :</p><p><br></p><p>· The certified merchants have disputes during the transaction, and the certified merchants are judged to be liable and perform corresponding obligations, but the certified merchants do not cooperate;</p><p><br></p><p>· Certificated merchants trading with accounts without real names on the platform;</p><p><br></p><p>· Certificated merchants using the platform to engage in any illegal activities;</p><p><br></p><p>· Certifies that the merchant violates the provisions of this Agreement or any legal document or transaction rules on the Website</p><p><br></p><p><br></p><p><br></p><p>(3) Certification process</p><p><br></p><p>1. You submit the application materials of certified merchants;</p><p><br></p><p>2. Upon receipt of the certification materials submitted by you, the Website will conduct compliance audits such as KYC and anti-money laundering based on such materials;</p><p><br></p><p>3. After you pass the compliance review of the website such as KYC and anti-money laundering, the platform will provide you with the identity of the exclusive authenticated merchant, so as to distinguish you from the unauthenticated merchant;</p><p><br></p><p>4. If you transfer the agreed margin to the margin account of the certified Merchant, the certified Merchant cannot trade or transfer the funds in the account.</p><p><br></p><p><br></p><p><br></p><p>(4) Cancellation of certification</p><p><br></p><p>1. If the certified merchant needs to rescind the certification, he/she shall submit an application for rescission to this website. After receiving the cancellation application, if the platform confirms that the verified merchant does not involve any pending disputes or has no bad records, etc., the website will complete the cancellation of the authentication within 3 working days and transfer the remaining funds in the margin account to the receiving account designated by you.</p><p><br></p><p>2. In case of any of the following situations, the platform has the right to unilaterally disqualify you as a certified merchant:</p><p><br></p><p>· Repeatedly complained by users of the platform in transactions;</p><p><br></p><p>· Any false information in the submitted certification materials;</p><p><br></p><p>· Dishonest behaviors such as fraud occurred in the transaction;</p><p><br></p><p>· Less than 60 points;</p><p><br></p><p>· Fail to cooperate with the customer service of the platform to process orders or deliberately delay the customer service to process orders;</p><p><br></p><p>· Malicious use of the rules of this platform for profit;</p><p><br></p><p>· Violates laws and regulations, this Agreement, or the legal documents or trading rules of the website; or</p><p><br></p><p>· There are behaviors that are not in line with public order and good customs and fair transactions identified by the platform.</p><p><br></p><p><br></p><p><br></p><p>(v) Understanding and recognition of certification services</p><p><br></p><p>1. The authentication service is an identity identification service provided by this website. Unless otherwise agreed herein, once you have completed the authentication in your account on the Website, the corresponding identity information and authentication results will not be modified or cancelled for any reason; If your identity information changes after completion of authentication, you shall provide the website with the certificate issued by the relevant authority, and the website shall assist you to change the authentication information corresponding to your account.</p><p><br></p><p>2. The Website has the right to unilaterally modify or change the content of this Agreement at any time, and the changed agreement text is announced through the Website without separate notice to you. By continuing to use the Services provided by the Website after any modification or change to this Agreement, you mean that you have read, understood and agreed to accept the changed Contents of this Agreement; If you do not agree to the changed content of the agreement, you should immediately stop the service of the Website.</p><p><br></p><p><br></p><p><br></p><p>(vi) The use of certification materials</p><p><br></p><p>· Management of authentication materials: The authentication materials you submit to the website at the time of authentication are irrevocably authorized to be retained by the website. The Website undertakes not to disclose, edit or disclose your authentication information except for statutory or agreed reasons, and not to use the non-public content stored on the website for commercial purposes, except in the following circumstances:</p><p><br></p><p>· This website is available to national judicial and administrative authorities;</p><p><br></p><p>· The website is provided to affiliates of the website;</p><p><br></p><p>· When a third party works with the Website to provide services to users, the third party provides you with relevant information required for the services (excluding your bank account information);</p><p><br></p><p>· For the purpose of resolving your civil disputes with third parties, the Website has the right to provide your identity information to such third parties.</p><p><br></p><p><br></p><p><br></p><p>(VII) Links to third-party websites</p><p><br></p><p>The Site may contain links to third party sites such as online banking sites (the \"Linked Sites\") for the purpose of identity information review. The Linked Site is not under the control of the Website, and the Website is not responsible for the content of any Linked Site, including but not limited to any links contained in the Linked Site, or any changes or updates to the Linked Site. The Website is not responsible for network transmission or other forms of transmission received from the Linked Site.</p><p><br></p><p><br></p><p><br></p><p>(8) it shall not be used illegally or prohibited</p><p><br></p><p>Acceptance of all terms of this Agreement is a prerequisite for your application for certification. You represent and warrant that you will not apply for authentication for any illegal or prohibited purpose under this Agreement. You shall not use the Certification Services in any way that may impair, disable, overload or impair the services of other sites or other sites or the use of the Site or interfere with the use of the application by others. You may not obtain or attempt to obtain any material or information without the permission of the Website.</p><p><br></p><p><br></p><p><br></p><p>(9) Relevant disclaimer</p><p><br></p><p>The Website shall not be liable for:</p><p><br></p><p>1. Your personal information is disclosed due to your disclosing your account password to others or your failure to keep your account password or to share your account with others or any other non-fault of the Website;</p><p><br></p><p>2. Any due to hacker attacks, computer viruses or attacks, the effects of telecom department technical adjustment in, temporarily closed due to government regulation, due to a third party (including force majeure, such as the trunk lines of the international export and international export telecom provider side failure, fire, flood, lightning, earthquake, flood, typhoon, tornado, volcano eruptions, plague, and epidemic of infectious diseases, strike, war, or violence or similar events, etc.) and other authentication information leakage caused by fault of this web site, lost, stolen, or has been tampered with, etc.;</p><p><br></p><p>3. Disclosure of bank account information caused by other websites linked to this website (such as online banking) and any legal disputes and consequences arising therefrom;</p><p><br></p><p>4. The Website shall have nothing to do with any failure to pass authentication or any other loss caused by users\' providing wrong, incomplete or false information to the Website;</p><p><br></p><p>5. Your assets are cheated by others for reasons other than those of the Platform.</p><p><br></p><p><br></p><p><br></p><p>10. Special statement</p><p><br></p><p>1. The basic information review and deposit requirements of the website on the certified merchants do not represent 100% reliability of the certified merchants, nor does it represent any warranty relationship between the Website and the certified merchants. Users of this website are requested to trade in strict accordance with the process, do a good job on the transaction party\'s information review, detailed communication, to ensure the safety of their own transactions and assets! At the same time, due to the particularity of digital asset transactions, you need to pay special attention to the risks of anti-money laundering, and check the identity of the counterparty in your transaction according to the requirements of KYC and anti-money laundering, otherwise you may be exposed to assets freezing and other risks due to the counterparty\'s suspected crimes.</p><p><br></p><p>2. The basic information review and deposit requirements of the website on the certified merchants do not represent 100% reliability of the certified merchants, nor does it represent any warranty relationship between the Website and the certified merchants. Users of this website are requested to trade in strict accordance with the process, do a good job on the transaction party\'s information review, detailed communication, to ensure the safety of their own transactions and assets! At the same time, due to the particularity of digital asset transactions, you need to pay special attention to the risks of anti-money laundering, and check the identity of the counterparty in your transaction according to the requirements of KYC and anti-money laundering, otherwise you may be exposed to assets freezing and other risks due to the counterparty\'s suspected crimes.</p>',0,'2020-07-13 09:50:01','2020-07-13 09:50:01','','',0,''),(80,25,3,'Company profile',0,'管理员','Company profile','Company profile','<h2 class=\"align-center\" style=\"text-align: center;\">BIT TIMES Global Digital Asset Exchange</h2><article class=\"page-content clearfix\"><strong>BIT TIMES</strong>&nbsp;(www.379maq.com) belongs to the BIT TIMES Group and is a digital asset trading platform serving global users.<br>We combine blockchain technology with traditional markets, bring together senior experts in global technology, branding, finance and other fields, as well as top international security experts.<br>BIT TIMES Group\'s global team has more than 20 R &amp; D engineers and has extensive experience in UI and financial technology.<br>The core team comes from well-known Internet companies such as Microsoft, IBM, Google, Alibaba, and Baidu.<br>With decades of implementation and innovation experience, they are true thought leaders who create and drive the industry forward.At the same time, we work closely with governments and regulatory agencies around the world to ensure that users are provided with secure, stable, and convenient digital assets. Trading services.<br>Our strength lies in merging today\'s financial world with the new world of the future. YooBTC is a good exchange.<br><br><strong>Angel round: $ 500,000</strong><br>Led by CF Network Ecosystem\'s distributed capital and PY Group, SAFUND followed.<br><br><strong>Core Value</strong><br>Focus on integrity<br><br><strong>Group Business Introduction</strong><br>BIT TIMES Exchange: provides digital asset trading services such as currency coins, contracts and financial derivatives for global investors.<br><br>Committed to creating a secure, fast, convenient and standard digital asset trading service platform for global users.<br><br><strong>Product advantages</strong><br>Adopt advanced technologies such as GSLB, distributed server clusters, distributed storage, multi-machine mutual backup high-speed memory transaction engines, cold wallets, and hot wallets with offline private keys to ensure the security, efficiency and stability of transaction services.<br><br>Rich trading patterns. The exchange supports currency trading, contract trading, and ETF fund models, allowing more transactions to happen here.<br>BIT TIMES will go all the way forward, adhering to the \"customer first\" concept, allowing global users to enjoy inclusive financial services.<br><br>BIT TIMES is committed to providing transparent and ethical communication between all parties involved. Your funds and personal data are protected by today\'s most powerful network solutions.</article>',0,'2020-07-13 09:50:49','2020-08-01 09:08:00','https://admin.379maq.com/','https://admin.379maq.com/',0,''),(81,26,3,'Legal notices',0,'管理员','Legal notices','Legal notices','<p class=\"p\"><span>Article 1 This Website is intended to provide professional, safe and trustworthy digital-assets transaction and asset management services to the digital asset enthusiasts and investors from all over the world to the greatest extent possible without violating relevant laws and regulations of the MSB United States Of America. However, if the country or region where you are based is a jurisdiction where digital asset transactions are explicitly prohibited or a jurisdiction included in the list of sanctioned countries, you shall refrain from using the services provided by this Website.</span><span><o:p></o:p></span></p><p class=\"p\"><span>Article 2 This Platform is committed to creating a compliant, safe and reliable digital asset trading environment for users thereof. Users thereof are prohibited from using this Website to engage in money laundering, smuggling, commercial bribery, malicious manipulation of the market and other illegal trading activities or illegal activities. In view of this, we, to the greatest extent possible, formulate a strict anti-money laundering and anti-terrorism program and take effective security risk control measures to maximize the legitimate rights and interests of users, and maintain the good reputation of the Platform.</span><span><o:p></o:p></span></p><p class=\"p\"><span>Article 3 When a competent authority, on the strength of relevant investigation warrant, requires the Platform to cooperate with it in investigating any specific User thereof, or to adopt such measures against the User’s account as closing or freezing such account or transferring assets from such account, this Website shall, after verifying the validity and authenticity of such warrant, provide the authority with relevant data of the User or carry out corresponding operations, so as to assist the investigation in accordance with the requirements of such competent authority. The Platform does not assume any responsibility for any direct or indirect loss that the User may sustain due to any disclosure of the User\'s privacy, or the User’s inability to operate his/her/its account due to such investigation.</span><span><o:p></o:p></span></p><p class=\"p\"