DROP TABLE IF EXISTS `otc_actions`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `otc_actions` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `detail_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '交易id',
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '触发操作的用户id',
  `buy_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '买方id',
  `sell_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '卖方id',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '参见模型定义',
  `operator_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '操作员类型:0.用户,1.系统,2.后台管理员',
  `public_msg` json NOT NULL COMMENT '买卖双方共享的消息',
  `to_buy_msg` json NOT NULL COMMENT '向卖方发送的消息',
  `to_sell_msg` json NOT NULL COMMENT '向买方发送的消息',
  `memo` varchar(255) NOT NULL DEFAULT '' COMMENT '说明',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `otc_atcion_index` (`detail_id`,`user_id`,`buy_user_id`,`sell_user_id`,`status`,`operator_type`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='法币交易各环节交易快照';
